import React from 'react'

const CallToAction = () => {
    return(
        <section className="call-to-action">
            <div className="call-to-action-content">
                <h1>Boost your links today</h1>
                <button className="started-button">Get Started</button>
            </div>
        </section>
    )
}

export default CallToAction
